import amber from '@material-ui/core/colors/amber'

const darkTheme = {
    palette: {
        primary: amber,
        type: 'dark',
        secondary: {
            main: '#5c6bc0',
        },
    },

    typography: {
        useNextVariants: true,
    },
}

export default darkTheme
